/*Table structure for table `T_SDF_AUTHORITY` */

DROP TABLE IF EXISTS `T_SDF_AUTHORITY`;

CREATE TABLE `T_SDF_AUTHORITY` (
  `ID` varchar(45) NOT NULL COMMENT '主键、唯一标识',
  `CODE` varchar(45) DEFAULT NULL COMMENT 'RULE_(拼音缩写)',
  `AUTH_NAME` varchar(45) DEFAULT NULL COMMENT '权限名称',
  `PARANT_AUTH_ID` varchar(45) DEFAULT NULL COMMENT '上级权限id',
  `URL` varchar(100) DEFAULT NULL COMMENT '功能菜单超链接',
  `AUTH_IMG` varchar(50) DEFAULT NULL COMMENT '权限图标',
  `STATUS` char(1) DEFAULT NULL COMMENT '状态(0:启用;1:停用;)',
  `CREATER` varchar(45) DEFAULT NULL COMMENT '录入人',
  `CREATER_TIME` timestamp NULL DEFAULT NULL COMMENT '录入时间',
  `MODIFY` varchar(45) DEFAULT NULL COMMENT '修改人',
  `MODIFY_TIME` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `IS_DELETED` char(1) DEFAULT NULL COMMENT '1:删除;0:正常;',
  `ISSYSTEM` varchar(255) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='权限信息表';

