/*Table structure for table `T_SDF_AGENT_RANGE` */

DROP TABLE IF EXISTS `T_SDF_AGENT_RANGE`;

CREATE TABLE `T_SDF_AGENT_RANGE` (
  `ID` varchar(45) NOT NULL,
  `AGENT_ID` varchar(45) DEFAULT NULL COMMENT '代理id',
  `PROVINCE_CODE` varchar(45) DEFAULT NULL COMMENT '代理省code',
  `CITY_CODE` varchar(45) DEFAULT NULL COMMENT '代理市code ，如果为空则表示省内的所有市',
  `AGENT_PROJETC_CODE` varchar(45) DEFAULT NULL COMMENT '代理的项目编码，具体参考T_SDF_AGENT_PROJECTS',
  `CREATER` varchar(45) DEFAULT NULL,
  `CREATE_DATE` date DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `FK8E72C42EA636870F` (`AGENT_ID`),
  CONSTRAINT `FK8E72C42EA636870F` FOREIGN KEY (`AGENT_ID`) REFERENCES `T_SDF_USERS` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

